        public var rawValue: Swift.String {
            switch self {
            case .earliest: return "earliest"
            case .latest: return "latest"
            case .timestamp: return "timestamp"
            case .trimHorizon: return "trim_horizon"
            case let .sdkUnknown(s): return s
            }
        }
    }
}

